KANG MAS PENGASINAN 
(Kami Datang Melayani Masyarakat Kelurahan Pengasinan)
Pamor kelurahan Pengasinan melakukan kegiatan KANG MAS PENGASINAN Mengenai Surat Keterangan Kematian langsung kerumah warga.

Pelayanan KANG MAS PENGASINAN ini bertujuan untuk memudahkan masyarakat, terutama mereka yang memiliki keterbatasan akses atau kondisi khusus, untuk mendapatkan layanan publik tanpa harus datang ke kantor. 

